import React, { useEffect, useRef, useCallback, useState } from 'react';
import { Helmet } from "react-helmet";
import { Navbar, Nav } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../assets/css/animate.min.css';
import '../assets/css/aos.min.css';
import '../assets/fonts/font-awesome.min.css';
import Collapse from 'bootstrap/js/dist/collapse';
import AOS from 'aos';
import FeetLogo from "../assets/img/feet dreams logo fav white.webp";
import FeetText from "../assets/img/feet dreams logo text white.webp";
import 'aos/dist/aos.css';
import '../assets/css/style-font.css';



function NavComponent(paramDict) {
  const mainNavRef = useRef(null);
  const navbarCollapseRef = useRef(null);
  const [collapse, setCollapse] = useState(null);

  const handleClick = useCallback(() => {
    if (collapse) {
      collapse.hide();
    }
  }, [collapse]);

  useEffect(() => {
    AOS.init({
      duration: 1000, // Default duration for all animations
    });
  }, []);
  
  useEffect(() => {
    const mainNav = mainNavRef.current;
    const navbarCollapse = navbarCollapseRef.current;
    if (mainNav && navbarCollapse) {
      const collapseInstance = new Collapse(navbarCollapse, { toggle: false });
      setCollapse(collapseInstance);
    }
  }, []);

  return (
    <div>
      <Helmet>
        <body id="page-top" data-bs-spy="scroll" data-bs-target="#mainNav" data-bs-offset="77" data-aos-easing="ease" data-aos-duration="400" data-aos-delay="0" />
      </Helmet>
      <Navbar bg="light" expand="md" fixed="top" className="navbar navbar-light navbar-expand-md fixed-top" id="mainNav">
        <Navbar.Brand href="index.html" className="navbar-brand d-grid">
          <img className="img-fluid d-block d-xxl-flex justify-content-xxl-start tada animated" src={FeetLogo} style={{background: "rgba(255,255,255,0)", margin: "-6px", padding: "0px", marginLeft: "0px", marginRight: "0px"}}/>
          <img className="img-fluid d-none d-sm-inline d-md-none d-lg-none d-xl-inline d-xxl-inline flex-shrink-1" data-bss-disabled-mobile="true" data-aos="fade" data-aos-duration="500" src={FeetText} style={{overflow: "visible", transform: "perspective(0px) skew(0deg)"}}/>
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" className="navbar-toggler navbar-toggler-right"/>
        <Navbar.Collapse id="responsive-navbar-nav" className="collapse navbar-collapse">
          <Nav className="navbar-nav ms-auto">
            <Nav.Link href="#about" onClick={handleClick} className="nav-link active nav-item nav-link">Qu'est-ce que c'est ?</Nav.Link>
            <Nav.Link href="#tarifs" onClick={handleClick} className="nav-link nav-item nav-link">Tarifs</Nav.Link>
            <Nav.Link href="#contact" onClick={handleClick} className="nav-link nav-item nav-link">Contact</Nav.Link>
            <Nav.Link href="#videos" onClick={handleClick} className="nav-link nav-item nav-link">Videos</Nav.Link>
            <Nav.Link href="/rendezvous" onClick={handleClick} className="nav-link tada animated nav-item nav-link" style={{backgroundColor: "#5c9688"}}>PRENDRE RENDEZ-VOUS</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    </div>
  )
}

export default NavComponent;
